import React from 'react';
import ProductCard from './ProductCard';

const VendorCard = ({ vendor }) => {
  return (
    <div className="vendor-card shadow p-3 mb-4 rounded">
      <div className="d-flex align-items-center justify-content-between">
        <div className="d-flex align-items-center">
          <img
            src={vendor.logoUrl || '/placeholder-logo.png'}
            alt={vendor.dispensaryName}
            className="rounded"
            style={{ width: '44px', height: '44px', objectFit: 'cover', marginRight: '10px' }}
          />
          <div>
            <h6 style={{ fontSize: '1rem', fontWeight: 'bold' }}>{vendor.dispensaryName}</h6>
            <p className="text-muted" style={{ fontSize: '0.85rem' }}>
              Minimum Order: ${vendor.minOrder || 'N/A'}
            </p>
          </div>
        </div>
      </div>
      <div className="products-preview mt-3">
        {vendor.products.length ? (
          <div className="d-flex overflow-auto" style={{ paddingBottom: '10px' }}>
            {vendor.products.slice(0, 10).map((product) => (
              <div key={product._id} style={{ minWidth: '200px', flex: '0 0 auto' }}>
                <ProductCard product={product} />
              </div>
            ))}
          </div>
        ) : (
          <p className="text-muted">No products available</p>
        )}
      </div>
    </div>
  );
};


export default VendorCard;
